import { useState } from 'react'


function MovieCard() {

    const [Series, setSeries] = useState({
        id: 0,
        title: "Arcane",
        description: " Arcane is an animated television series set in the League of Legends universe The series was unveiled during the League of Legends 10th Anniversary celebrations It is currently being developed and produced by Riot and animated by Fortiche Productions in Paris France The first season was expected to release in 2020, however it was delayed until 2021 in light of the COVID19 outbreak It was announced on May 3rd 2021 that it would premiere exclusively on Netflix in the fall of 2021.[2] On September 25th, 2021, the release date for the first 3 episodes was revealed to be on November 6th, 2021.[3] Episodes will be released in 3 Acts, with each act composing of 3 episodes.[4] Episodes are roughly 40 minutes long.[5] Based on the world behind League of Legends, Arcane dives into the delicate balance between the rich, utopian city of Piltover Crest icon.png Piltover and the seedy, oppressed underground of Zaun Crest icon.png Zaun. Known across Runeterra as the city of progress,  many of the most brilliant minds call these cities home.But the creation of hextech, a way for any person to control magical energy, threatens that balance.The story follows the origins of two iconic League champions- and the power that will tear them apart.Like the game on which it is based, Arcane is aimed at a[+16] audience and will deal with some more adult subject matter.",
        url: "https://static.wikia.nocookie.net/leagueoflegends/images/7/7d/Arcane_2021_Logo.jpg/revision/latest/scale-to-width-down/350?cb=20211024000745",
        rating: 5,
    }







































